import BBFC_PG from '../../../Media/Classifications/BBFC_PG.png';

const CC02 = () => {
    return ( 
        <>
          <tr>
            <td><img src={BBFC_PG} alt="Parental Guidance Rating Logo" width="100%"/></td>
            <td><h3>PG - Parental Guidance</h3></td>
          </tr>
       </>
     );
}

export default CC02;
